import { my_face } from "./images/my-face.jpeg";

export function Bio() {
  return (
    <div>
      <aside class="icons">
        <a href="mailto:teodora.botezatu@epitech.eu">
          <i class="fa-solid fa-envelope"></i>
        </a>
        <a href="https://github.com/dodoll27" target="_blank">
          <i class="fab fa-github"></i>
        </a>
        <a
          href="https://www.linkedin.com/in/teodora-botezatu-b87537205/"
          target="_blank"
        >
          <i class="fa-brands fa-linkedin"></i>{" "}
        </a>
        <i class="fa-solid fa-phone"></i>{" "}
      </aside>{" "}
      <div class="title">
        {" "}
        <div class="my-name">
          <h1>Teodora Botezatu</h1>{" "}
        </div>{" "}
        <div class="speciality">
          <p>Gen-Z Software Developer</p>
          <div class="specialty-background"></div>{" "}
        </div>{" "}
        <div class="about-me">
          //{" "}
          <p>
            // I am a highly driven software developer student at Epitech. I //
            adapt easily due to my versatile background. I enjoy learning and //
            have a strong work ethic. I thrive both in team environments and //
            when working independently. I am dynamic, sociable, organized, and
            // possess a strong team spirit. //{" "}
          </p>{" "}
        </div>{" "}
      </div>{" "}
      <div class="my-face">
        {" "}
        <div class="mobile-background">
          <img src={my_face} width="340" height="360" />{" "}
        </div>{" "}
      </div>
      <div class="main-background"></div>
    </div>
  );
}
